import 'package:ieca_mobile/enums/hymns_content_code.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/_import.dart';

class UmHymnsOmesaYaNala{
  static List<HymnsContent> list = [
    HymnsContent(id: 2037, position: 1, content: "Palo tu mola Yesu Kupolo, \nPalo tu mola evi viokilu. \nPalo tu likuminya ekolelo. \nPalo tu sima lika via Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_105, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2038, position: 2, content: "Tu lila palo ombolo yomuenyo, \nTu nyuila palo ovinyu viokilu, \nPalo tu sanga esumuluho \nLina liongecelo yovakandu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_105, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2039, position: 3, content: "Palo tu tuli upongo, akuetu, \nHa tu kalapo vosi lesanju, \nLina lia tu kokela ongecelo \nYakandu etu Yesu a fila.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_105, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2040, position: 4, content: "Cetu akandu, cove esunga; \nCetu eviho, cove onjelo. \nWa tu walisa esunga nduwalo \nUna wa sesamela kovailu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_105, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2041, position: 5, content: "Cilo tua mãla; tu lisandola;\nPuãi haimo ohenda yove yenda ño. \nOmbolo yi pua, haico ovinyu, \nPuãi ove o kala kumue letu hu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_105, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2042, position: 1, content: "Tu timbuile ombolo, \nA Cime cetu, \nNdeci wa yi timbuile \nKonahulu. \nOmbolo yomuenyo \nTu livela. \nNdo tu yi timbuile, \nOkuahenda.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_106, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2043, position: 2, content: "Ndeci ko Ngalileya \nWa tekula, \nVana va ku kuama \nHa ve kuta, \nNdo tu tekulevo, \nTua lambuka, \nHa tu ku kuama ño \nLekolelo.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_106, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2044, position: 3, content: "Ove Umbolo yaco \nWa liecele, \nHu fila omanu, \nVa popelue. \nUnekui yutima, \nTu ku sole. \nTu ku imbile ovaso, \nTu tekule.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_106, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2045, position: 4, content: "Tu tume Espiritu, \nLiu tu wile. \nLiu tu letuluise \nTu ku mõle. \nLi ku tukuluise \nKolondaka, \nHa tu tundi noke \nLonjolela.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_106, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2046, position: 1, content: "Kombolo lokovinyu \nNdimbuka Cime cange, \nWa file wa pinduka. \nA Ñala, hu pandula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_107, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2047, position: 2, content: "Ovindekaise evi \nVi simisa via Suku, \nVina viaye viokilu. \nA Ñala, hu pandula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_107, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2048, position: 3, content: "Vi njimbise ovaso \nKekulusu lia Yesu. \nViti, Ameli kulo. \nA Ñala, hu pandula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_107, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2049, position: 4, content: "Poku tambula ombolo \nSokolola etimba, \nLia Yesu lia nekela. \nA Ñala, hu pandula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_107, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2050, position: 5, content: "Haico ovinyu vi kola \nVi ndekisa osonde ya'e, \nNdomo ya mesekela. \nA Ñala, hu pandula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_107, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2051, position: 1, content: "A Tate, tu ku tiamela \nOmo Yesu a tu fila. \nTu ongoloka locisola \nTua limbuka ku Yesu. \nWa pesela osonde yaye \nHa tu sukula akandu, \nKuenda wa tu longisavo \nNdomo Ove u Tate.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_108, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2052, position: 2, content: "Osimbu tua tuñayaile, \nTua nyelile kupãla. \nEye wa tu sandiliya, \nWa tu nena konjo ya'e. \nTua hukile, wa tu ecela, \nWa tu sola ndonjali. \nTua tambuiwa lonjolela \nHa tu kala laye hu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_108, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2053, position: 3, content: "Eye wa tu muisa eyovo \nHa tu kala komesa. \nTua sanjuka, tu pandula \nOhenda ya liwewa. \nTu ivaluka ondaka yina \nWa usikile osimbu, hati, \nCi lingaingi otembo yosi \nHa wu njivaluka ame.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_108, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2054, position: 1, content: "Ndukuaku lambuka \nElambu liesunga. \nHaime ndukuenyona, \nEnyona liovutima.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_109, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2055, position: 2, content: "Umbolo yocili \nYa tunda kovailu. \nNekule, a Yesu, \nUnekui yovitima.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_109, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2056, position: 3, content: "Uyuva wocili, \nU muisa esanju. \nNdo muise etaili, \nEsanju liove, a Yesu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_109, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2057, position: 4, content: "Nda mita kekango \nLiohali lesumuo, \nA Yesu, songuile; \nÑolela ohenda yove.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_109, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2058, position: 1, content: "A Yesu, Uyuva wocili, \nOngunja Suku So yove. \nTu li pamosi, Ove Uti, \nEtu tua linga olonavi.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_110, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2059, position: 2, content: "A Yesu, Umbolo yomuenyo, \nTu lialia loku ivaluka. \nEtimba liove ongambu, \nLi tu tekula kutima.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_110, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2060, position: 3, content: "Komesa yove ovinyu, \nTu nyuanyua loku ivaluka. \nOsonde yove yi kola, \nYi tu sukula kutima.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_110, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2061, position: 4, content: "Tu li pamosi, akuetu; \nOkufa kua’e tu ivaluka. \nCilo ongeva, okufa tupu, \nYesu o ka tu pindula.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_110, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2062, position: 1, content: "Okulia kua posoka \nKuohenda ya Suku. \nKuvakuetavo ku pepa; \nOkulia kuokilu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_111, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2063, position: 2, content: "Tu kasi vosi kulo \nNdomãla vamuamue. \nLoku lia ombolo yokilu \nLoku nyua ovinyu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_111, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2064, position: 3, content: "Ombolo yi lekisa \nEtimba lia Yesu. \nOvinyu vi tu ivaluisa \nOsonde ya Kristu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_111, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2065, position: 4, content: "Cosi ci tu ivaluisa \nNdomo a tu fila. \nKuenda ci tu lekisa \nNdomo tua soliwa.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_111, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2066, position: 5, content: "Tu ku sivaya, a Suku, \nKuenda tu pandula. \nOmo wa eca Omolove \nOku tu popela.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_111, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2067, position: 1, content: "Etali kolofeka \nKu kuete onjala; \nKu moleha ombolo \nYocili yokilu. \nOmbolo yi imula \nOnjala yovutima. \nVa liako va tambula \nOmuenyo wenda hu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_112, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2068, position: 2, content: "Etali kolofeka \nKu kuete enyona, \nPuãi ku li ovava awa \nA kola, a yela. \nEyona liovutima \nLi vala ca piãla, \nLovava año oluali \nKa imula enyona mbu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_112, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2069, position: 3, content: "Va tava ovo va lia \nKomesa ya Yesu, \nOnjala yi va imuha \nLondaka ya Yesu. \nEnyona li va imuha \nLoku nyua ovava, \nAna a kuete omuenyo \nKa takayata mbu.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_112, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2070, position: 1, content: "Ongombo wetu wocisola, \nItima vietu via lambuka. \nElambu liovilongua viove, \nNdo tu tekule, Okuahenda.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_113, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2071, position: 2, content: "Ongombo wetu Ukuacili, \nItima vietu via lambuka. \nLehungu liovoluali lulo, \nTu pongolole, Okuahenda.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_113, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2072, position: 3, content: "Ongombo wetu Ukuepandi, \nItima vietu via leñela. \nTu ihe ongusu ye Espiritu, \nOco tu yule ovayonjo.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_113, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2073, position: 4, content: "Ongombo wetu Ukuacali, \nOve Umbolo yi kuete omuenyo. \nVosi va yi lia lelavoko, \nVa kuata omuenyo una ko pui.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_113, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2074, position: 5, content: "Ongombo wetu Ukueyovo, \nNdo kale letu otembo yosi. \nTeya ongumbo yovakandu, \nYa vindikiya ulamba wove.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_113, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2075, position: 1, content: "Ombolo yomuenyo, ombolo yokilu, \nOmbolo yokilu Ñala Yesu; \nOmbolo yi eca vutima \nEsanju, Ombembua locinyi.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_114, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2076, position: 2, content: "Osonde ya pesela Yesu \nYi kola kuenda ya tila; \nOsonde yaco yi nena kutima \nOngusu, ocisola lomuenyo.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_114, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2077, position: 3, content: "Enju a Yesu ndo sumuluise, \nNju kisiwe love a Ñala; \nMomo njongola oku ku  vumba \nLoku ku sivaya a Ñala yange.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_114, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2078, position: 1, content: "Eliño li sukuiwa pi?\nVosonde ya Yesu lika. \nEyovo li sangiwa pi? \nVosonde ya Yesu lika.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_115, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2079, content: "Kono yosonde eyi, \nNda yelisiwa pe; \nLayimue vali nji, \nOsonde ya Yesu lika.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_115, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2080, position: 2, content: "Utima ndo yelisa pe, \nVosonde ya Yesu lika. \nLomuenyo haico ndo mola, \nVosonde ya Yesu lika.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_115, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2081, position: 3, content: "Nda yovoka kakandu, \nLosonde ya Yesu lika. \nNda limuisa esunga \nLosonde ya Yesu lika.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_115, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2082, position: 4, content: "Onjolela lesanju, \nKosonde ya Yesu lika. \nLombembua yina ya Suku, \nKosonde ya Yesu lika.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_115, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2083, position: 1, content: "Utima wange wa lembelekua. \nOku puyukila ku Suku; \nEye o sanjukila oku neyuila: \nOku puyukila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_116, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2084, content: "Epuyuko, \nKovoko a Suku yange hu, \nNda koka hu, \nOku puyukila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_116, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2085, position: 2, content: "Ngenda ko vaso lesanju lialua \nOku puyukila ku Suku; \nCosi haciyula lunene waye; \nOku puyukila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_116, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2086, position: 3, content: "La cimue ño haci yokokela, \nOku puyukila ku Suku. \nOmbembua, epuiti sanga ku Ñala, \nOku puyukila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_116, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2087, position: 4, content: "Ovoyaki hu ha pitahãla, \nOku puyukila ku Suku; \nPuãi kaka siapo oka ñuata, \nOku puyukila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_116, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2088, position: 1, content: "Kuli ono yiwa yosonde, \nYa eciwa komanu vosi \nLomola a Suku ongunga \nHa va moli omuenyo ko pui. \nNdaño ame nda tungayala, \nLoku linga ovina via senga \nNjuise vosonde yokameme. \nOco ame njele pe.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_117, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2089, content: "Ndocikokoto, ndocikokoto. \nNjuise vosonde yokameme, \nOco ame njele pe.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_117, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2090, position: 2, content: "Vo futisa olosongo, \nWa mola osoi kekulusu, \nWa tala olohali via lua, \nOku tu muisa eyovo. \nSonguile kono yaco a Ñala, \nYi nombokaile osimbu yosi. \nNjuise vosonde yokameme, \nOco ame njele pe.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_117, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2091, position: 3, content: "A Tate nda tungayala \nUtima u kasi lahuku, \nAkandu ange a kusuka, \nOvava ka a yelisa mbu. \nA Ñala kono yomuenyo \nNdo songuileko lohenda: \nSukule kutima a Suku, \nOco ame njele pe.", hymnsNumber: UmHymnsNumberSeeder.OMESA_YA_NALA_117, typeStanza: HymnsContentCode.VERSE),
  ];
}